app.controller('ContextMenu', ['$document', '$scope', 'watch', 'keys', 'stage', function($document, $scope, watch, keys, stage) {
	var vm = this,
		coords,
		menus = {
			base : {
				modesTitle : true,
				erase : true,
				selection : true,
				paint : true,
				move : true
			},
			selection : {
				selectionTitle : true, 
				delete : true, 
				combine : true
			},
			fill : {
				fill : true
			}
		};

	vm.stage = stage;
	vm.contextMenu = false;

	vm.options = menus.base;

	$document.on('mousemove', function(e) {
		coords = {left :  e.pageX + 20, top : e.pageY};
	}).on('keydown', function(e) {
		if(keys(e) === 'esc'){
			vm.contextMenu = false;
			vm.options = menus.base;
			$scope.$apply();
		}
	});
	$('canvas').on('contextmenu', function(e) {
		vm.contextMenu = true;
		vm.contextMenuPos = {left : e.pageX + 20, top : e.pageY};
		$scope.$apply();		
		return false;
	});

	watch(stage, 'showcontextMenu', function(newValue) {
		vm.contextmenu = false;
		if(newValue){
			if(menus[newValue])
				vm.options = menus[newValue];
			else vm.options = menus.base;
			vm.contextMenu = true;
			vm.contextMenuPos = coords;
		}else{
			vm.contextMenu = false;
			vm.options = menus.base;
		}
	});

	vm.deleteSelected = function() {
		stage.modes.selection.destroySelectedItems();
		vm.contextMenu = false;
		vm.options = menus.base;
	};

	vm.combineSelected = function() {
		stage.modes.selection.combineSelectedItems();
		vm.contextMenu = false;
		vm.options = menus.base;
	};

	vm.fillSelected = function() {
		stage.modes.selection.fillSelected();
		vm.contextMenu = false;
		vm.options = menus.base;
	}

	vm.setMode = function(mode) {
		stage.setMode(mode);
		vm.contextMenu = false;
	}
}]);
app.controller('FileController', ['stage', '$scope', '$http', 'keys', '$document', '$timeout', 'keyEvents',
 	function(stage, scope, $http, keys, $doc, $timeout, keyEvents) {

	var vm = this;
	vm.stage = stage;
	vm.keys = {};
	vm.newFileWidth = 2000;
	vm.newFileHeight = 2000;
	vm.newFileExtension = 'js';

	vm.save = function() {
		console.log('save');
		if(!vm.stage.currentFile.isDirty)return;


		if(vm.stage.currentFile.name === 'untitled.js')
			vm.showSaveMenu = true;
		else {
			vm.saveTileMap();
		}
	}

	vm.showSaved = function() {
		vm.saved = true;
		$timeout(function() {
			vm.saved = false;
		}, 1000);
	}
	vm.saveAs = function() {
		vm.showSaveMenu = true;
	}
	vm.hideSaveMenu = function() {
		vm.showSaveMenu = false;
	}
	
	vm.saveTileMap = function() {
		vm.hideSaveMenu();
		stage.file.save();
		vm.updateTileMaps();
		vm.showSaved();
	}

	vm.showCreateFileMenu = function(type) {
		vm.newFileType = type.camelCaseToText();
		vm.showCreateNewFileMenu = true;
	}
	vm.createNewFile = function() {
		vm.newFileName = vm.newFileName.split('.')[0] + '.' + vm.newFileExtension;
		vm.showCreateNewFileMenu = false;
		console.log(vm.newFileExtension);
		vm.stage.file.createFile(vm.newFileName, {
			name : vm.newFileName,
			w : vm.newFileWidth, 
			h : vm.newFileHeight
		});
		vm.newFileName = '';
	}
	vm.hideNewFileMenu = function() {
		vm.showCreateNewFileMenu = false;
	}
	vm.updateTileMaps = function() {
		vm.maps = [];
		$http.get('/tilemap-names').then(function(data) {
			for(var i = 0; i < data.data.length; i++){
				vm.maps.push({
					label : data.data[i],
					id : data.data[i]
				});
			}
		});
		
	}

	vm.updateTileMaps();

	keyEvents.register('keydown', 'ctrl', function() {
		vm.keys.ctrl = true;
	});
	keyEvents.register('keydown', 's', function() {
		if(vm.keys.ctrl)
			vm.save();
	});
	keyEvents.register('keyup', 'ctrl', function() {
		vm.keys.ctrl = false;
	});

}]);
