app.factory('Draw', function() {
		
	function Draw(stage) {
		this.stage = stage;
		this.lines = [];

		this.selectedItems = [];
	}

	Draw.prototype = {
		line : function (x, y, endX, endY) {
			var g = new createjs.Shape();
			g.graphics.beginStroke("rgba(255,255,255,0.5)");
			g.graphics.moveTo(x,y); 
			g.graphics.lineTo(endX,endY);
			this.stage.addChild(g);
			this.lines.push(g);
			return g;
		},
		selection : function(x, y, w, h) {
			w = w - x;
			h = h - y;
			this.destroySelection();
			this.selectionBox = this.square(x, y, w, h);
			return this.selectionBox;
		},
		destroySelection : function() {
			if(this.selectionBox)this.stage.getStage().removeChild(this.selectionBox);
		},
		square : function(x, y, w, h, stroke, color) {
			var g = new createjs.Shape();
			g.graphics.beginStroke(stroke || "blue")
				.beginFill(color || "rgba(18, 30, 185, 0.58)")
				.drawRect(x, y, w, h);
			this.stage.addChild(g);

			return g;
		},
		img : function(obj) {
			var img = new createjs.Bitmap(this.stage.preload.queue.getResult(obj.element));
			img.x = obj.x;
			img.y = obj.y;
			img.scaleY = (obj.h || this.stage.CELL_HEIGHT) / img.image.height;
			img.scaleX = (obj.w || this.stage.CELL_WIDTH) / img.image.width;
			this.stage.addChild(img);
			return img;
		},
		clearLines : function() {
			for(var i = 0; i < this.lines.length; i++){
				this.stage.removeChild(this.lines[i]);	
			}
			this.lines = [];
		},
		drawCanvasGrid : function() {
			for(var i = 1; i < this.stage.rows; i++)
				this.line(0, i * this.stage.CELL_HEIGHT, this.stage.getStage().canvas.width, i * this.stage.CELL_HEIGHT);
			for(var i = 1; i < this.stage.cols; i++)
				this.line(i * this.stage.CELL_WIDTH, 0, i * this.stage.CELL_WIDTH, this.stage.getStage().canvas.height);
		}
	}

	return Draw;
});

app.factory('File', ['$http', '$rootScope', function($http, $rootScope) {
	function File(stage) {
		this.stage = stage;
	}

	File.prototype = {
		createFile : function(id, obj) {
			if(this.getFileById(id))return;
			this.stage.dontUpdateMiniMap = true;
			this.stage.clearStageItems();
			this.stage.files[id] = {
				name : id,
				items : [],
				size : obj && obj.w && obj.h ? ({w : obj.w, h : obj.h}) : {w : this.stage.baseWidth, h : this.stage.baseHeight}
			};
			this.changeFile(id);
			this.stage.updateCanvas();
			if(obj.data)
				this.createItemsFromRaw(obj.data);
			this.stage.snapshot.updateSnapshotCanvas();
		},
		closeFile : function(id) {
			this.stage.dontUpdateMiniMap = true;
			var fileList = Object.keys(this.stage.files),
				prevOpenFile = fileList.indexOf(id) - 1,
				nextOpenFile = fileList.indexOf(id) + 1,
				fileToFocus = fileList[prevOpenFile > -1 ? prevOpenFile : nextOpenFile];

			delete this.stage.files[id];
			if(fileToFocus && this.stage.currentFile.name === id){
				this.stage.clearStageItems();
				this.changeFile(fileToFocus);
				this.drawCurrentFile();
			}
			this.stage.snapshot.updateSnapshotCanvas();
		},
		loadTileMap : function(map) {
			$http.get('/load-tilemap/' + map.id).then(function(data) {
				this.createFile(map.id, data.data);
			}.bind(this));
		},
		changeFile : function(file) {
			this.stage.currentFile = this.stage.files[file];
		},
		drawCurrentFile : function() {
			var items = this.stage.currentFile.items;
			for(var i = 0; i < items.length; i++)
				items[i].drawImg();
			this.stage.updateCanvas();
		},
		drawFile : function(id) {
			this.stage.clearStageItems();	
			this.stage.currentFile = this.getFileById(id);
			this.drawCurrentFile();	
			this.stage.snapshot.updateSnapshotCanvas();
		},
		createItemsFromRaw : function(items) {
			for(var i = 0; i < items.length; i++)
				this.stage.createItem(items[i]);
		},
		getFileById : function(id) {
			for(var i in this.stage.files)
				if(this.stage.files[i].name === id)return this.stage.files[i];
		},
		save : function() {
			this.stage.currentFile.isDirty = false;
			this.stage.tileMap.jsonTileMap();
			this.stage.currentFile.saved = true;
			setTimeout(function() {
				this.stage.currentFile.saved = false;
			}.bind(this), 1000);
		}
	}

	return File;
}]);
app.factory('Item', function () {
	function Item(stage, obj) {
		this.stage = stage;
		this.row = obj.row;
		this.col = obj.col;
		this.rows = obj.rows;
		this.cols = obj.cols;
		this.x = obj.x;
		this.y = obj.y;
		this.w = obj.w;
		this.h = obj.h;
		this.file = obj.file;
		this.src = obj.src;
		this.id = obj.id
		this.element = obj.element;
		this.body = obj.body;
		this.type = obj.elType;
	}

	Item.prototype = {
		drawImg : function() {
			this.img = this.stage.draw.img(this);
			this.img.on('click', this.mousedown.bind(this));
			this.img.on('pressmove', this.pressmove.bind(this));
		},
		mousedown : function() {
			if(this.selected)
				this.deselect();
			else
				this.select();
		},
		pressmove : function(e) {
			this.stage.modes.move.move();
		},
		move : function (obj) {
			if(isNaN(obj.row) || isNaN(obj.col))return;
			this.y = (this.row + obj.row) * this.stage.CELL_HEIGHT;
			this.img.y = this.y;
			this.selectionBox.y = this.selectionBox.y + (obj.row * this.stage.CELL_HEIGHT);
			this.row += obj.row;
		
			this.x = (this.col + obj.col) * this.stage.CELL_WIDTH;
			this.img.x = this.x;
			this.selectionBox.x = this.selectionBox.x +  (obj.col * this.stage.CELL_WIDTH);
			this.col += obj.col;
		},
		select : function() {
			if(this.selected)return;
			this.selectionBox = this.stage.draw.square(this.x, this.y, this.w, this.h, 'red', 'transparent');	
			this.selected = true;
			this.stage.updateSelectedItems();
		},
		destroy : function() {
			this.destroyImages();
			this.stage.destroyItem(this);
			this.selected = false;
			this.stage.updateSelectedItems();
		},
		destroyImages : function() {
			this.stage.removeChild(this.img);
			if(this.selectionBox)
				this.stage.removeChild(this.selectionBox);
			this.selected = false;

		},
		deselect : function() {
			this.stage.removeChild(this.selectionBox);
			this.selected = false;
			this.stage.updateSelectedItems();
		}
	}

	return Item;
});
app.factory('Snapshot', ['$timeout', function($timeout) {
	function Snapshot(stage) {
		this.stage = stage;
		this.snapshotStage = new createjs.Stage(document.createElement('canvas'));
	}

	Snapshot.prototype = {
		create : function(canvas) {
			var timer = Date.now();
			var image = new Image();
			image.src = canvas.toDataURL();
			return image;
		},
		updateCanvas : function() {
			this.snapshotStage.canvas.width = this.stage.currentFile.size.w;
			this.snapshotStage.canvas.height = this.stage.currentFile.size.h;	
		},
		updateSnapshotCanvas : function() {
			var children = [],
				stage = this.stage.getStage();

			this.snapshotStage.children = null;
			for(var i = 0; i < stage.children.length; i++){
				if(!stage.children[i].graphics)
					children.push(stage.children[i].clone(true));
			}
			this.snapshotStage.children = children;
			this.snapshotStage.update();
			this.createSnapShot();
		},
		createSnapShot : function() {
			this.stage.canvasImage = this.create(this.snapshotStage.canvas);
		}
	}

	return Snapshot;
}]);
app.factory('stage', [
	'Preload', 'Draw', 'TileMap', 'Item', '$http', 'Selection', 'Paint', 'Erase', 'Move', 
	'keys', 'cursor', '$rootScope', 'Snapshot', 'File',
	function(Preload, Draw, TileMap, Item, $http, Selection, Paint, Erase, Move, 
			keys, cursor, $rootScope, Snapshot, File) {

	function Stage(stageId) {
		this.CELL_WIDTH	= 25;
		this.CELL_HEIGHT = 25;
		this.mode = 'paint';
		this.stage = new createjs.Stage(stageId);

		this.baseWidth = 2000;
		this.baseHeight = 2000;

		// Classes
		this.draw = new Draw(this);
		this.tileMap = new TileMap(this);
		this.snapshot = new Snapshot(this);
		this.file = new File(this);
		this.preload = new Preload;

		// Modes
		this.modes = {
			paint : new Paint(this),
			selection : new Selection(this),
			move : new Move(this),
			erase : new Erase(this)
		}

		this.files = {
			'untitled.js' : {
				name : 'untitled.js',
				items : [],
				size : {w : this.baseWidth, h : this.baseHeight}
			}
		};
		this.currentFile = this.files['untitled.js'];
		this.currentFileName = 'untitled.js';
		this.rows = this.stage.canvas.height / this.CELL_HEIGHT;
		this.cols = this.stage.canvas.width / this.CELL_WIDTH;


		
	}

	Stage.prototype = {
		init : function() {
			this.preload.init(function(items) {
				for(var i = 0; i < items.length; i++){
					items[i].elType = 'floor';
					items[i].body = 'static';
				}
				this.loadedItems = items;
				this.currentItem = items[0];
				this.setupClickEvents();
				this.updateCanvas();
				this.update();
				this.snapshot.createSnapShot();
				$rootScope.$apply();
			}.bind(this));
		},
		keydown : function(e) {
			if(e.target.localName === 'input')return true;

			var key = keys(e);
			if(key === 'delete')
				this.modes.selection.destroySelectedItems();
			if(key === 'esc')
				this.modes.selection.deselectItems();
			if(key === 'p')
				this.setMode('paint');
			if(key === 's')
				this.setMode('selection');
			if(key === 'm')
				this.setMode('move');
			if(key === 'e')
				this.setMode('erase');
		},
		setupClickEvents : function() {
			this.getStage().on('stagemousedown', this.mouseDown.bind(this));
			this.getStage().on('stagemouseup', 	this.mouseUp.bind(this));
			this.getStage().on('stagemousemove', this.mouseMove.bind(this));
		},
		updateCanvas : function() {
			if(!this.draw)return;
			this.dontUpdateMiniMap = true;
			this.rows = this.currentFile.size.h / this.CELL_HEIGHT;
			this.cols = this.currentFile.size.w / this.CELL_WIDTH;
			this.stage.canvas.width = this.currentFile.size.w;
			this.stage.canvas.height = this.currentFile.size.h;
			this.snapshot.updateCanvas();
			this.draw.clearLines();
			this.draw.drawCanvasGrid();	
		},
		setCurrentItem : function(id) {
			this.currentItem = this.getLoadedItemById(id);
		},
		mouseDown : function(e) {
			if(e.nativeEvent.button !== 0)return;

			this.currentFile.isDirty = true;
			this.showcontextMenu = false;
			this.drawing = true;
			this.mouseDownMouseCoords = this.getMouseAndRowCoords(e);


			this.setModeFromMouseEvent('MouseDown', e)
		},
		mouseUp : function(e) {
			if(e.nativeEvent.button !== 0)return;
			this.drawing = false;	
			this.savedMode = false;
			this.mouseUpMouseCoords = this.getMouseAndRowCoords(e);
			this.showcontextMenu = false;
			this.dontUpdateMiniMap = false;

			this.setModeFromMouseEvent('MouseUp', e);
		},
		mouseMove : function(e) {
			this.mouseMoveMouseCoords = this.getMouseAndRowCoords(e);
			if(this.modes[this.mode][this.mode + 'FollowMouse'])this.modes[this.mode][this.mode + 'FollowMouse'](e);

			if(!this.drawing)return;
			if(this.isMoving){
				this.overRideMode = 'move';
			} else this.overRideMode = false;

			this.setModeFromMouseEvent('', e);
			this.dontUpdateMiniMap = false;


		},
		setMode : function(mode) {
			cursor.change(mode);
			for(var i in this.modes)
				if(this.modes[i].cleanUp)this.modes[i].cleanUp();
			this.mode = mode;
		},
		setSize : function(size) {
			this.updateCanvas();
		},
		setModeFromMouseEvent : function(mouseEvent, e) {
			if(this.overRideMode){
				if(this.modes[this.overRideMode][this.overRideMode + mouseEvent])
					this.modes[this.overRideMode][this.overRideMode + mouseEvent](e);
			} else{
				if(this.modes[this.mode][this.mode + mouseEvent])
					this.modes[this.mode][this.mode + mouseEvent](e);
			}
		},
		getMouseAndRowCoords : function(e) {
			var obj = {
				x : e.stageX,
				y : e.stageY,
			}
			obj.coords = this.getRowColFromXY(obj.x,obj.y);
			obj.row = obj.coords.row;
			obj.col = obj.coords.col;
			return obj;
		},
		
		createItemByXYWH : function(x, y, w, h) {
			if(typeof x === 'object'){
				y = x.y;
				w = x.w;
				h = x.h;
				x = x.x;
			}
			var rowCol = this.getRowColFromXY(x, y),
				endRowCol = this.getRowColFromXY(x + w, y + h)
				startRow = rowCol.row,
				startCol = rowCol.col,
				endRow = endRowCol.row,
				endCol = endRowCol.col,
				obj = {
					row : startRow,
					col : startCol,
					file : this.currentItem.file,
					src : this.currentItem.src,
					element : this.currentItem.element,
					y : startRow * this.CELL_HEIGHT,
					x : startCol * this.CELL_WIDTH,
					w : (endCol - startCol + 1) * this.CELL_WIDTH, 
					h : (endRow - startRow + 1) * this.CELL_HEIGHT
				}

			this.createItem(obj);
		},
		updateSelectedItems : function() {
			this.selectedItems = this.modes.selection.getSelectedItems();	
		},
		updateLoadedItem : function(id, attr, value) {
			var item = this.getLoadedItemById(id);
			item[attr] = value;	
		},
		createItem : function(row, col, x, y, w, h, file, src, element) {
			var obj = row instanceof Object ? row : {
				row : row, 
				col : col, 
				x : x, 
				y : y,
				w : w,
				h : h,
				file : file,
				src : src,
				element : element
			}, item;

			if(this.getItemByXY(x, y))return;
			obj = $.extend(obj, this.getLoadedItemById(element));
			item = new Item(this, obj);
			item.drawImg();
			
			this.addItem(item);
		},
		
		addItem : function(obj) {
			this.currentFile.items.push(obj);
		},
		
		clearStageItems : function() {
			this.dontUpdateMiniMap = true;
			for(var i = 0; i < this.currentFile.items.length; i++)
				this.currentFile.items[i].destroyImages();
		},
		destroyItem : function(item) {
			item.destroyImages();
			this.currentFile.items.splice(this.currentFile.items.indexOf(item), 1);
		},
		getRowColFromXY : function(x, y) {
			return {row : Math.floor(y / this.CELL_HEIGHT), col : Math.floor(x / this.CELL_WIDTH)};
		},
		getItemsByXYWH : function(x, y, w, h) {
			var els = [];
			for(var i = x; i < x + w; i++)
				for(var j = y; j < y + h; j++){
					var item = this.getItemByXY(i, j);
					if(item && els.indexOf(item) < 0)els.push(item);
				}
			return els;
		},
		getItemByXY : function(x, y) {
			var item;
			for(var i = 0; i < this.currentFile.items.length; i++){
				item = this.currentFile.items[i];
				if( item.x <= x && item.y <= y && item.x + item.w > x && item.y + item.h > y)return item; 
				
			}
		},
		getStage : function() {
			return this.stage;	
		},
		getLoadedItemById : function(id) {
			for(var i = 0; i < this.loadedItems.length; i++)
				if(this.loadedItems[i].id === id)return this.loadedItems[i];	
		},
		addChild : function(child) {
			this.stage.addChild(child);
			if(!this.dontUpdateMiniMap){
				console.log('updateg');
				this.snapshot.updateSnapshotCanvas();
			}
		},
		removeChild : function(child) {
			this.stage.removeChild(child);
			if(!this.dontUpdateMiniMap)
				this.snapshot.updateSnapshotCanvas();
		},
		
		update : function() {
			setInterval(function() {
				this.stage.update();
			}.bind(this), 10)
		},
	}

	var stage = new Stage('map-creator');
	stage.init();
	return stage;
}]);

