app.factory('Preload', ['$http', function($http) {
	
	function Preload() {
		$http.get('/manifest');
		this.manifest = [
			{src: "marbleFloor.jpg", id: "marblefloor"},
			{src: "wood.jpg", id: "wood"},
			{src: "box.jpg", id: "box"},
			{src: "rocket.png", id: "rocket"}
		];

		
	}

	Preload.prototype = {
		init : function(cb) {
			this.queue = new createjs.LoadQueue(true);
			this.queue.on("progress", this.handleProgress);
			this.queue.on("complete", this.handleComplete.bind(this, cb));
			this.queue.on("fileload", this.handleFileLoad);
			$http.get('/manifest').then(function(manifest) {
				this.manifest = manifest.data;
				this.queue.loadManifest(manifest.data, true, "tilemaps/img/");
			}.bind(this));
		},
		handleComplete : function(cb, items) {
			setTimeout(function() {
				$('canvas').show();
				$('.grid-tabs').show();
				$('.progress-container').hide();
				cb(this.manifest);
			}.bind(this), 1000);
		},
		handleProgress : function(e) {
			$('.progress-bar').width(100 * e.progress + '%');
		},
		handleFileLoad : function() {
		}
	}
	return Preload
}]);

app.factory('TileMap', ['$http', function($http) {
	
	function TileMap(stage) {
		this.stage = stage;
	}

	TileMap.prototype = {
		jsonTileMap : function() {
			var arr = [],
				file = this.stage.currentFile;
			for(var i = 0; i < file.items.length; i++){
					var item = file.items[i];
					arr.push({
						row : item.row, 
						col : item.col, 
						x : item.x,
						y : item.y,
						w : item.w,
						h : item.h,
						el : item.element,
						sprite : item.fileName,
						file : item.file,
						element : item.element,
						src : item.src
					});
			}
			

			var obj = {
				w : file.size.w,
				h : file.size.h,
				data : arr
			}
			$http.post('/save-tilemap', {name : file.name, data: obj});
			return obj;

		},
	}

	return TileMap;
}]);

app.factory('watch', ['$rootScope', function($rootScope) {
	return function(cl, key, cb) {
		$rootScope.$watch(function() {
			return cl[key];
		}, function(newValue, oldValue) {
			if(newValue === oldValue)return;
			cb(newValue, oldValue);
		});
		
	}
}]);